<p>Please tell me why this is happening?
What problems can I expect in the future if I leave it this way?</p>; Answer: The only thing that tweak ever did was disable _Explorer_'s caching of DLLs. This was necessary for developers working on Explorer plugins - without it Explorer would keep old versions of the plugin DLLs mapped, making them difficult to replace with new versions for testing. That this tweak was specific to Explorer is indicated by the fact that it's found in a subkey under Explorer's key in the registry. It had nothing to do with caching of DLLs in general. DLLs may be prefetched but other than that they are demand-paged like all other code (except nonpageable kernel mode code).

